import React from "react";
import Typical from "react-typical";

function AboutMe() {
	return (
		<section>
			<h1>Hey, I'm Naail: </h1>
			<Typical
				steps={[
					"Hello, I'm Naail!",
					1000,
					"Welcome to my website!",
					1000,
					"Enjoy your stay!",
					1000,
				]}
				loop={Infinity}
				wrapper="p"
			/>
			<p>
				I'm an MIT-trained computer scientist and semi-professional poker player
				based in Cambridge, MA.
			</p>
			<p>
				I'm a semi-professional poker player and MIT-trained computer scientist.
			</p>
			<p>Now, I work on trading systems at Novig.</p>
		</section>
	);
}

export default AboutMe;
